import React, { useState } from "react";
import PieChartFood from "./PieChartFood";
import PieChartBeverage from "./PieChartBeverage";
import BarChartComponent from "./BarChartComponent";
import RouteLineChart from "./RouteLineChart";
import logo from "../assets/inflight-logo.png";

function Dashboard() {
  const [selectedRoute, setSelectedRoute] = useState("NYC-LAX");

  const handleRouteChange = (e) => {
    setSelectedRoute(e.target.value);
  };

  const handleFilterClick = () => {
    // handle logic here if needed
    console.log("Filtered by route:", selectedRoute);
  };

  return (
    <div style={{ padding: "1.5rem", fontFamily: "Arial, sans-serif" }}>
      {/* Header */}
      <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
        <div style={{ display: "flex", alignItems: "center", gap: "0.75rem" }}>
          <img src={logo} alt="In-Flight Insights Logo" style={{ height: "58px", background: "none" }} />
          <h1 style={{ fontSize: "1.9rem", color: "#2b61d1", margin: 0 }}>In-Flight Insights Dashboard</h1>
        </div>
        <div style={{ display: "flex", gap: "1.5rem", fontWeight: "bold", color: "#2b61d1" }}>
          <span>Dashboard</span>
          <span>Reports</span>
          <span>Settings</span>
          <span>Profile</span>
        </div>
      </div>

      {/* KPI Cards */}
      <div style={{ display: "flex", justifyContent: "space-between", marginTop: "2rem", marginBottom: "1.5rem" }}>
        {[
          { label: "ðŸ’° Cost Savings", value: "$1.2M" },
          { label: "â™»ï¸ Waste Saved", value: "210 kg" },
          { label: "âœˆï¸ Routes Analyzed", value: "350" },
          { label: "ðŸŒ COâ‚‚ Saved", value: "28 tonnes" },
        ].map((item, idx) => (
          <div
            key={idx}
            style={{
              background: "linear-gradient(to right, #d9fdd3, #e1f2ff)",
              padding: "1.3rem 1.8rem",
              borderRadius: "12px",
              flex: 1,
              margin: "0 0.5rem",
              textAlign: "center",
              boxShadow: "0 2px 6px rgba(0,0,0,0.05)",
            }}
          >
            <div style={{ fontWeight: "bold", fontSize: "1.1rem" }}>{item.label}</div>
            <div style={{ fontSize: "1.6rem", fontWeight: "bold", marginTop: "0.3rem" }}>{item.value}</div>
          </div>
        ))}
      </div>

      {/* ðŸ”„ Filter Bar (Moved here) */}
      <div style={{ display: "flex", justifyContent: "center", marginBottom: "1.5rem", gap: "1rem" }}>
        <select
          value={selectedRoute}
          onChange={handleRouteChange}
          style={{ padding: "0.5rem", fontSize: "1rem", borderRadius: "5px" }}
        >
          <option value="NYC-LAX">NYC-LAX</option>
          <option value="SEA-JFK">SEA-JFK</option>
        </select>
        <button
          onClick={handleFilterClick}
          style={{
            padding: "0.5rem 1rem",
            fontSize: "1rem",
            backgroundColor: "#2b61d1",
            color: "white",
            border: "none",
            borderRadius: "5px",
            cursor: "pointer",
          }}
        >
          Filter by Flight Route
        </button>
      </div>

      {/* Pie Charts + Route Trend */}
      <div style={{ display: "flex", gap: "1.5rem", marginBottom: "2rem" }}>
        {/* Pie Charts */}
        <div style={{ flex: 1, background: "#f8f8f8", padding: "1.5rem", borderRadius: "12px" }}>
          <h3 style={{ textAlign: "center" }}>Consumption Breakdown</h3>
          <div style={{ display: "flex", justifyContent: "space-around" }}>
            <div style={{ textAlign: "center" }}>
              <h4>Food</h4>
              <PieChartFood />
            </div>
            <div style={{ textAlign: "center" }}>
              <h4>Beverages</h4>
              <PieChartBeverage />
            </div>
          </div>
        </div>

        {/* Route-Specific Waste Trend */}
        <div style={{ flex: 1, background: "#f8f8f8", padding: "1.5rem", borderRadius: "12px" }}>
          <h3 style={{ textAlign: "center" }}>Route-Specific Waste Trend</h3>
          <RouteLineChart />
        </div>
      </div>

      {/* Waste by Age Group */}
      <div style={{ marginTop: "2rem" }}>
        <h3>Waste by Age Group</h3>
        <BarChartComponent />
      </div>
    </div>
  );
}

export default Dashboard;
